    def toJSON(self):
        return json.dumps(self, default=lambda o: o.__dict__, 
            sort_keys=True, indent=4)

    def __eq__(self, obj):
        if(obj == None):
            if ((not self) or self.metadata == None):
                return True
            else:
                return False
        return self.metadata == obj.metadata
    
    def __str__(self):
        return self.toJSON()
    
